import React from 'react'

import { Sidebar } from '../components/Sidebar'

import { getProfile } from '../utils/spotify'

const Home = async ({ accessToken }) => {
    var data = await getProfile();
    console.log(data)
    return (
        <div className='grid grid-cols-2'>
            <Sidebar />
            {data.toString()}
        </div>
    )
}

export default Home
